        <>
            <section className="third-section-about">
                <div className="div-third-section-about">
                    <h4 className="paragraph-third-section-about">Ayudando a las peque√±as y medianas empresas</h4>
                    <h1 className="heading-third-section">Retener e inspirar su clientela</h1>
